import { React, useState } from 'react';
import Barra from '../Navbar/Navbar';
import './Registrase.css'
import { Form, Col, InputGroup, Button } from 'react-bootstrap';

function Registrase () {
    const [validated, setValidated] = useState(false);

    const handleSubmit = (event) => {
      const form = event.currentTarget;
      if (form.checkValidity() === false) {
        event.preventDefault();
        event.stopPropagation();
      }
  
      setValidated(true);
    };

  return (
      <div>
          <Barra />
        <div>
          <Form noValidate validated={validated} onSubmit={handleSubmit}></Form>
          <h1>Registrarse</h1>
          <Form.Group as={Col} md="12" controlId="validationCustomUsername">
          <Form.Label>Correo</Form.Label>
          <InputGroup hasValidation>
            <Form.Control
              type="email"
              placeholder=""
              aria-describedby="inputGroupPrepend"
              required
            />
            <Form.Control.Feedback type="invalid">
              Por favor digite un correo valido.
            </Form.Control.Feedback>
          </InputGroup>
        </Form.Group>

        <Form.Group as={Col} md="12" controlId="validationCustom03">
          <Form.Label>Contraseña</Form.Label>
          <Form.Control type="password" placeholder="" required />
          <Form.Control.Feedback type="invalid">
            Por favor digite su contraseña.
          </Form.Control.Feedback>
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicCheckbox">
    <Form.Check type="checkbox" label="Recordarme" />
  </Form.Group>
  <Button variant="outline-secondary" type="submit">Ingresar</Button>{' '}
  <p></p>
  <a href="/OlvidoContrasena">¿Olvido su contraseña?</a>
        </div>
      </div>
  );

};

export default Registrase;
